body:
@fs-eire with the latest build (following your gist: [here](https://gist.github.com/fs-eire/a55b2c7e10a6864b9602c279b8b75dce)) with the following code with the same model and inputs as @xenova : 
```
<script src="./dist/ort.webgpu.min.js"></script>
<script>
    document.addEventListener('DOMContentLoaded', async () => {

     // Load model
     let url = 'https://huggingface.co/Xenova/bert-base-cased_web/resolve/main/onnx/model_quantized.onnx'
     let model = await fetch(url);
     let buffer = await model.arrayBuffer();
     let array = new Uint8Array(buffer);

     // Create a new session
     ort.env.wasm.simd = false;
     ort.env.wasm.numThreads = 1;
     let session = await ort.InferenceSession.create(array)
      ...
   })
</script>
```
results in the following error at line `ort.InferenceSession.create` :
```
Uncaught (in promise) Error: no available backend found. ERR: [wasm] RuntimeError: Aborted(TypeError: WebAssembly.instantiate(): Import #0 module="a" error: module is not an object or function), [cpu] Error: previous call to 'initializeWebAssembly()' failed., [xnnpack] Error: previous call to 'initializeWebAssembly()' failed., [webgpu] Error: previous call to 'initializeWebAssembly()' failed.
```

If I provide only `'webgpu'` as `executionProviders`, the error is as follows:
```
Uncaught (in promise) Error: no available backend found. ERR: [wasm] RuntimeError: Aborted(TypeError: WebAssembly.instantiate(): Import #0 module="a" error: module is not an object or function)
```
which is the same as before.

If I use `<script src="./dist/ort.js"></script>` instead of `ort.webgpu.min.js` and use `webgpu` as `executionProviders`, the error is: `Uncaught (in promise) Error: no available backend found.`

So, I got the imports working (for [this build](https://dev.azure.com/onnxruntime/onnxruntime/_build/results?buildId=1009937&view=results)), but I'm getting a lot of errors when running a simple text-classification [model](https://huggingface.co/Xenova/distilbert-base-uncased-finetuned-sst-2-english/blob/main/onnx/model.onnx):

input:
```js
{
    attention_mask: Tensor {
      type: 'int64',
      data: [1n, 1n, 1n],
      dims: [1,3],
    },
    input_ids: Tensor {
      type: 'int64',
      data: [101n, 3231n, 102n],
      dims: [1,3],
    },
}
```

![image](https://github.com/microsoft/onnxruntime/assets/26504141/9417dffc-6f00-47b2-956d-402b43bdb0a9)

I’ve been trying to compile these files locally all day, but I keep getting an error: “Can’t create a session.” Even with the latest npm package, the issue persists. But the "onnxruntime-web": "^1.16.0-dev.20230508-045c623415" works well on wasn provider.

I’m using the Whisper model, and regardless, I sincerely appreciate your help. I hope you can integrate WebGPU to Transformers.js  soon  . Good night, my friend, from the other side of the Earth. 
@xenova
